import image from './Background1.jpeg'

function Info() {
    return (
        <>
            <div style={{position: "relative"}}>
            <img src={image} style={{width: '1440px', height: '750px'}} alt={"Nothing"}/>
            <section id="home">
                <h1 style={{fontStyle: 'montserrat', textAlign: 'center', marginTop: '5%'}}>Find Listings Around Macalester College</h1>
            </section>
            </div>
        </>
    );
}

export default Info;
